export const Ajouter=(Calcule)=>{
    return{
        type:'Ajouter',
        payload:Calcule
    }
}

export const Reset=()=>{
    return{
        type:'Reset'
    }
}

export const AjouterFilm=(Film)=>{
    return{
        type:'Ajouter',
        payload:Film
    }
}

export const AjouterRealisateur=(Realisateur)=>{
    return{
        type:'Ajouter',
        payload:Realisateur
    }
}
